import React from 'react'
import { Link } from "react-router-dom";

const MyPage = () => {
  return (
    <div>
        
        <Link to="/list">
          <Button variant="light">회원검색</Button>
        </Link>
        <Link to="/delete">
          <Button variant="light">회원탈퇴</Button>
        </Link>
    </div>
  )
}

export default MyPage
